_url'><a href='http://eur-lex.europa.eu/LexUriServ/LexUriServ.do?uri=COM:2006:0360:FIN:ES:PDF' target='_blank'>eur-lex.europa.eu</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 1381515246,26187483,0,0,1,0,0,\"854b2212d098e42aa00c54a6c5bd24e0\")' class='button_thumbUp tooltip_help' id='buttonUpImg1381515246' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 1381515246,26187483,0,0,0,0,0,\"854b2212d098e42aa00c54a6c5bd24e0\")' class='button_thumbDown tooltip_help' id='buttonDownImg1381515246' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_7371110111_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\nPour the sauce from cooking<b class='b1'> t</b><b class='b2'>h</b><b class='b3'>e</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'> </b><b class='b3'>i</b><b class='b2'>n</b><b class='b1'> t</b>he pan and cook the rice, adding stock whenever necessary. <div class='source_url_spacer'>jumboeurope.com</div>\r\n<div class='source_url'><a href='http://www.jumboeurope.com/en/recipes/detail/denton_relleno/' target='_blank'>jumboeurope.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\nPoner la salsa de l<b class='b1'>a </b><b class='b2'>cocción</b><b class='b1'> e</b>n la cacerola y cocer el arroz, añadiendo caldo cuando sea necesario. <div class='source_url_spacer'>jumboeurope.com</div>\r\n<div class='source_url'><a href='http://www.jumboeurope.com/es/recipes/detail/denton_relleno/' target='_blank'>jumboeurope.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 7371110111,21311308,0,0,1,0,0,\"bb04bdb15ad240257b9898dcf4fcc18a\")' class='button_thumbUp tooltip_help' id='buttonUpImg7371110111' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 7371110111,21311308