9063ad390a720a0a8aec180d77b336c8\")' class='button_thumbDown tooltip_help' id='buttonDownImg6666885346' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_5134163344_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\n<div class='shortened_begin2'>I am not against it but it</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n cannot be paid for with p<b class='b1'>ap</b><b class='b2'>e</b><b class='b3'>r</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'> </b><b class='b3'>t</b><b class='b2'>h</b><b class='b1'>ro</b>ugh a fisheries agreement. <div class='source_url_spacer'>europarl.europa.eu</div>\r\n<div class='source_url'><a href='http://www.europarl.europa.eu/sides/getDoc.do?pubRef=-//EP//TEXT+CRE+20030902+ITEMS+DOC+XML+V0//EN&amp;amp;language=EN' target='_blank'>europarl.europa.eu</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\n<div class='shortened_begin2'>No estoy en contra, pero no</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n puede pagarse con peces de papel en virtud de u<b class='b1'>n </b><b class='b2'>acuer</b><b class='b3'>do </b><b class='b4'>de</b><b class='b5'> pesca</b>. <div class='source_url_spacer'>europarl.europa.eu</div>\r\n<div class='source_url'><a href='http://www.europarl.europa.eu/sides/getDoc.do?pubRef=-//EP//TEXT+CRE+20030902+ITEMS+DOC+XML+V0//ES&amp;amp;language=ES' target='_blank'>europarl.europa.eu</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 5134163344,23908253,0,0,1,0,0,\"1bf679684f6d324631014bde201d2f57\")' class='button_thumbUp tooltip_help' id='buttonUpImg5134163344' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 5134163344,23908253,0,0,0,0,0,\"1bf679684f6d324631014bde201d2f57\")' class='button_thumbDown tooltip_help' id='buttonDownImg5134163344' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_3890509933_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\nIt is time we realised that we have to main<b class='b1'>ta</b><b class='b2'>i</b><b class='b3'>n</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'> </b><b class='b3'>s</b><b class='b2'>t</b><b class='b1'>oc</b>ks. <div class='source_url_spacer'>europarl.europa.eu</div>\r\n<div class='source_url'><a href='http://www.europarl.europa.eu/sides/getDoc.do?pubRef=-//EP//TEXT+CRE+20030604+ITEMS+DOC+XML+V0//EN&amp;amp;language=EN' target='_blank'>europarl.europa.eu</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\nYa es hora de que nos demos cuenta de que debemos mantene<b class='b1'>r </b><b class='b2'>las</b><b class='b1'> p</b>oblaciones d<b class='b1'>e </b><b class='b2'>peces</b>. <div class='source_url_spacer'>europarl.europa.eu</div>\r\n<div class='source_url'><a href='http://www.europarl.europa.eu/sides/getDoc.do?pubRef=-//EP//TEXT+CRE+20030604+ITEMS+DOC+XML+V0//ES&amp;amp;language=ES' target='_blank'>europarl.europa.eu</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 3890509933,23061397,0,0,1,0,0,\"5416b384cc65a90ccd2a0c129a85f262\")' class='button_thumbUp tooltip_help' id='buttonUpImg3890509933' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 3890509933,23061397,0,0,0,0,0,\"5416b384cc65a90ccd2a0c129a85f262\")' class='button_thumbDown tooltip_help' id='buttonDownImg3890509933' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_5345046157_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\nThen add the piece<b class='b1'>s </b><b class='b2'>o</b><b class='b3'>f</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'> </b><b class='b3'>a</b><b class='b2'>n</b><b class='b1'>d </b>cook for 10 minutes. <div class='source_url_spacer'>jumboeurope.com</div>\r\n<div class='source_url'><a href='http://www.jumboeurope.com/en/recipes/detail/denton_relleno/' target='_blank'>jumboeurope.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\nAñadir después<b class='b1'> l</b><b class='b2'>os tr</b><b class='b3'>ozo</b><b class='b4'>s d</b><b class='b5'>e pescado y</b><b class='b4'> co</b><b class='b3'>cer</b><b class='b2'>los 1</b><b class='b1'>0 </b>minutos. <div class='source_url_spacer'>jumboeurope.com</div>\r\n<div class='source_url'><a href='http://www.jumboeurope.com/es/recipes/detail/denton_relleno/' target='_blank'>jumboeurope.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 5345046157,19920613,0,0,1,0,0,\"7e0609953579e2137c0e876328d9bace\")' class='button_thumbUp tooltip_help' id='buttonUpImg5345046157' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 5345046157,19920613,0,0,0,0,0,\"7e0609953579e2137c0e876328d9bace\")' class='button_thumbDown tooltip_help' id='buttonDownImg5345046157' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_2939488232_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\n<div class='shortened_begin2'>Work with the end products of</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n agriculture in pla<b class='b1'>nt</b><b class='b2'>s</b><b class='b3'>,</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'>,</b><b class='b3'> </b><b class='b2'>l</b><b class='b1'>iv</b>estock, and poultry <span class='placeholder_end2'> [...]</span>\r\n<div class='shortened_end2'>to process them into food products with a longer shelf life.</div>\r\n <div class='source_url_spacer'>utm.mx</div>\r\n<div class='source_url'><a href='http://www.utm.mx/ing_alimentos_eng.html' target='_blank'>utm.mx</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\n<div class='shortened_begin2'>Trabaja con productos</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n resultado de l<b class='b1'>a </b><b class='b2'>agric</b><b class='b3'>ult</b><b class='b4'>ura</b><b class='b5'>, pesca, </b><b class='b4'>gan</b><b class='b3'>ade</b><b class='b2'>ría y</b><b class='b1'> a</b>vicultura <span class='placeholder_end2'> [...]</span>\r\n<div class='shortened_end2'>para transformarlos en alimentos con mayor vida útil.</div>\r\n <div class='source_url_spacer'>utm.mx</div>\r\n<div class='source_url'><a href='http://www.utm.mx/ing_alimentos.html' target='_blank'>utm.mx</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 2939488232,37010453,0,0,1,0,0,\"c3ab6207662cf018c50efab1a0ef12bc\")' class='button_thumbUp tooltip_help' id='buttonUpImg2939488232' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 2939488232,37010453,0,0,0,0,0,\"c3ab6207662cf018c50efab1a0ef12bc\")' class='button_thumbDown tooltip_help' id='buttonDownImg2939488232' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_9700219006_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\nThe line of se<b class='b1'>le</b><b class='b2'>c</b><b class='b3'>t</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'> </b><b class='b3'>a</b><b class='b2'>n</b><b class='b1'>d </b>shellfish pates has been one the <span class='placeholder_end2'> [...]</span>\r\n<div class='shortened_end2'>most successful in the market.</div>\r\n <div class='source_url_spacer'>conservasasturias.com</div>\r\n<div class='source_url'><a href='http://conservasasturias.com/Pates-and-cakes' target='_blank'>conservasasturias.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\nLa línea de pat<b class='b1'>és</b><b class='b2'> sele</b><b class='b3'>cto</b><b class='b4'>s d</b><b class='b5'>e pescado y</b><b class='b4'> ma</b><b class='b3'>ris</b><b class='b2'>co ha</b><b class='b1'> s</b>ido una <span class='placeholder_end2'> [...]</span>\r\n<div class='shortened_end2'>de las de más éxito en el mercado.</div>\r\n <div class='source_url_spacer'>conservasasturias.com</div>\r\n<div class='source_url'><a href='http://conservasasturias.com/Pates' target='_blank'>conservasasturias.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 9700219006,40155726,0,0,1,0,0,\"de3e395dba00fb91d4fadd762714292c\")' class='button_thumbUp tooltip_help' id='buttonUpImg9700219006' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 9700219006,40155726,0,0,0,0,0,\"de3e395dba00fb91d4fadd762714292c\")' class='button_thumbDown tooltip_help' id='buttonDownImg9700219006' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_5879522476_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\n<div class='shortened_begin'>You can also choose to descend one of the slopes that take you to the docks of the cosy Port of Ciutadella, where you can taste the</div>\r\n<span class='placeholder_begin'>[...] </span>\r\n<div class='shortened_begin2'> best tapas in its fishermen&#039;s bars or</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n delight in eating the delicious is<b class='b1'>la</b><b class='b2'>n</b><b class='b3'>d</b><b class='b4'> </b><b class='b5'>fish</b><b class='b4'> </b><b class='b3'>a</b><b class='b2'>n</b><b class='b1'>d </b>seafood that its restaurants offer. <div class='source_url_spacer'>menurka.com</div>\r\n<div class='source_url'><a href='http://www.menurka.com/en/menorca/hostel/surroundings' target='_blank'>menurka.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\n<div class='shortened_begin'>También puede optar por descender por alguna de las cuestas que llevan a los muelles del acogedor puerto de Ciutadella, donde podrá degustar las mejores</div>\r\n<span class='placeholder_begin'>[...] </span>\r\n<div class='shortened_begin2'> tapas en sus bares de pescadores o</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n deleitarse con<b class='b1'> e</b><b class='b2'>l ex</b><b class='b3'>quis</b><b class='b4'>it</b><b class='b5'>o pescado y</b><b class='b4'> m</b><b class='b3'>aris</b><b class='b2'>co d</b><b class='b1'>e </b>la isla que ofrecen sus restaurantes. <div class='source_url_spacer'>menurka.com</div>\r\n<div class='source_url'><a href='http://www.menurka.com/es/menorca/hostal/entorno' target='_blank'>menurka.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 5879522476,41425552,0,0,1,0,0,\"acdb3998c01d1c265443af8de8f20d17\")' class='button_thumbUp tooltip_help' id='buttonUpImg5879522476' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 5879522476,41425552,0,0,0,0,0,\"acdb3998c01d1c265443af8de8f20d17\")' class='button_thumbDown tooltip_help' id='buttonDownImg5879522476' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_2837454440_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\n<div class='shortened_begin2'>The cooperative is also about to embark on a new project</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n to raise fresh w<b class='b1'>at</b><b class='b2'>e</b><b class='b3'>r</b><b class='b4'> </b><b class='b5'>fish</b>. <div class='source_url_spacer'>imf.org</div>\r\n<div class='source_url'><a href='http://www.imf.org/External/NP/EXR/cs/eng/2005/082605.htm' target='_blank'>imf.org</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\n<div class='shortened_begin2'>La cooperativa también está a punto de emprender un nuevo proyecto para</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n criar pece<b class='b1'>s </b><b class='b2'>de ag</b><b class='b3'>ua </b><b class='b4'>dulce</b>. <div class='source_url_spacer'>imf.org</div>\r\n<div class='source_url'><a href='http://www.imf.org/External/NP/EXR/cs/esl/2005/082605.htm' target='_blank'>imf.org</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='col_rating'>\r\n<a onclick='vote(event, 2837454440,42343977,0,0,1,0,0,\"43335eff85d2050dceea375233f29d5b\")' class='button_thumbUp tooltip_help' id='buttonUpImg2837454440' title='Vote up' alt='thumb up'></a>\r\n<a onclick='vote(event, 2837454440,42343977,0,0,0,0,0,\"43335eff85d2050dceea375233f29d5b\")' class='button_thumbDown tooltip_help' id='buttonDownImg2837454440' title='Vote down' alt='thumb down'></a>\r\n</td>\r\n\r\n<td class='col_edit' colspan=2>&nbsp;</td>\r\n</tr>\r\n\r\n\r\n<tr id='row_0_6158847843_0' class='' >\r\n<td class='sentence left'><div class='wrap'>\r\n<div class='shortened_begin2'>An integrated gel pack in the lid dispenses with the need for crushed ice avoiding both additional costs</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n and potential damage to<b class='b1'> t</b><b class='b2'>h</b><b class='b3'>e</b><b class='b4'> </b><b class='b5'>fish</b>. <div class='source_url_spacer'>microban.com</div>\r\n<div class='source_url'><a href='http://www.microban.com/europe/english/products/commercial-foodservice/transport-storage/cool-blue-box' target='_blank'>microban.com</a></div><div class='behindLinkDiv'></div>\r\n</div></td>\r\n<td class='sentence right2'><div class='wrap'>\r\n<div class='shortened_begin2'>Un paquete de gel incorporado a la tapa ahorra la necesidad de utilizar hielo, lo cual evita costes y</div>\r\n<span class='placeholder_begin2'>[...] </span>\r\n el posible<b class='b1'> d<